import React, { Component } from "react";
import { Consumer } from "../../context";

export default class Tracks extends Component {
  render() {
    return (
      <Consumer>
        {value => {
          return <h1>{value.heading}</h1>;
        }}
      </Consumer>
    );
  }
}
